geregisseerd door Denis Villeneuve
met Hugh Jackman, Jake Gyllenhaal en Paul Dano

Keller Dover (Hugh Jackman) wordt geconfronteerd met de ergste nachtmerrie van een ouder. Zijn zes jaar oude dochter Anna en haar vriendinnetje Joy worden vermist. Het enige aanknopingspunt is een vervallen camper die eerder in hun straat is geparkeerd. Rechercheur Loki (Jake Gyllenhaal) leidt het onderzoek en arresteert de bestuurder Alex Jones (Paul Dano). Wegens gebrek aan bewijs moet hij de verdachte echter weer laten gaan. Wetende dat het leven van zijn dochter op het spel staat besluit Dover het heft in eigen hand te nemen.



